import React from "react";

export default function LocationItem({
  imagePath,
  text,
  label,
  location,
  path,
}) {
  return (
    <div>
      <figure data-category={label}>
        <img src={imagePath} alt="" />
      </figure>
      <div>{text}</div>
      <div>{location}</div>
    </div>
  );
}
